A camisa 7 do Manchester United possui uma mística especial. Grandes jogadores desfilaram pelos gramados ingleses e europeus e conquistaram importantes títulos ornando o número que possui especial relação com a memória afetiva do torcedor dos Red Devils. Não à toa: George Best, Bryan Robson, Eric Cantona, David Beckham e Cristiano Ronaldo estão entre os maiores jogadores da história do clube e levavam o número 7 às costas.

.

Apesar de ser muito lembrado por seu temperamento explosivo e sua coleção de polêmicas, Eric Cantona é uma figura muito relevante para a história do Manchester United e sua qualidade técnica merece ser enfatizada. Dotado de invejável qualidade técnica, o francês foi o grande craque dos primórdios da era Premier Legue.

.

Cantona se tornou um personagem  folclórico no futebol mundial e é visto até hoje como um dos mais polêmicos na história do esporte bretão. As análises atuais tendem a valorizar mais o personagem explosivo e agressivo - principalmente no fatídico episódio do chute "kung fu" em um torcedor do Crystal Palace - que o grande craque que foi. Fato é que o Bad Boy foi Rei em Old Trafford e é um dos maiores ídolos históricos do time vermelho de Manchester. 

.

Após sua contribuição para o domínio nacional dos Red Devills nos anos 90, encerrando uma fila de 26 anos sem levantar um caneco do campeonato inglês, Cantona chegou a ser eleito o grande nome da história do clube em eleição popular em 2001, ficando acima de jogadores como George Best, Bobby Charlton e Dennis Law. A idolatria do torcedor pelo francês ajudou a tornar ainda mais intensa a mística em torno da camisa 7 do United.

 .

Os personagens polêmicos têm lugar especial no coração dos apaixonados por futebol. Qual seu Bad Boy favorito, futebolitas?
.
.
